import React, { useState, useEffect } from 'react'
import { Link, useNavigate, useParams } from 'react-router-dom';
import ClienteService from '../../services/ClienteService.js';
import LivroService from '../../services/LivroService.js';

const AddUpdateClienteComponent = () => {

    const [name, setName] = useState('')
    const [rua, setRua] = useState('')
    const [numero, setNumero] = useState('')
    const [bairro, setBairro] = useState('')
    const [cidade, setCidade] = useState('')
    const [estado, setEstado] = useState('')
    const [cep, setCep] = useState('')
    const history = useNavigate();
    const { id } = useParams();

    const saveOrUpdateLivro = (e) => {
        e.preventDefault();

        const cliente = { name, rua, numero, bairro, cidade, estado, cep}

        if (id) {
            ClienteService.updateCliente(id, cliente).then((response) => {
                window.location.href = "/";
            }).catch(error => {
                console.log(error)
            })

        } else {
            ClienteService.createCliente(cliente).then((response) => {

                console.log(response.data)

                window.location.href = "/";

            }).catch(error => {
                console.log(error)
            })
        }

    }

    useEffect(() => {

        LivroService.getLivroById(id).then((response) => {
            setName(response.data.name)
            setRua(response.data.rua)
            setNumero(response.data.numero)
            setBairro(response.data.bairro)
            setCidade(response.data.cidade)
            setEstado(response.data.estado)
            setCep(response.data.cep)
        }).catch(error => {
            console.log(error)
        })
    }, [])

    const title = () => {

        if (id) {
            return <h1 className="text-center">Atualizar Cliente</h1>
        } else {
            return <h1 className="text-center">Adicionar Cliente</h1>
        }
    }

    return (
        <div>
            <br /><br />
            <div className="container-add">
                <div className="row">
                    <div className="card col-md-6 offset-md-3 offset-md-3">
                        {
                            title()
                        }
                        <div className="card-body">
                            <form>
                                <div className="form-group mb-2">
                                    <input
                                        type="text"
                                        placeholder="Nome"
                                        name="name"
                                        className="form-control"
                                        value={name}
                                        onChange={(e) => setTitulo(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className="form-group mb-2">
                                    <input
                                        type="text"
                                        placeholder="Autor"
                                        name="autor"
                                        className="form-control"
                                        value={autor}
                                        onChange={(e) => setAutor(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className="form-group mb-2">
                                    <input
                                        type="editora"
                                        placeholder="Editora"
                                        name="editora"
                                        className="form-control"
                                        value={editora}
                                        onChange={(e) => setEditora(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className="form-group mb-2">
                                    <input
                                        type="linkImg"
                                        placeholder="LinkImg"
                                        name="linkImg"
                                        className="form-control"
                                        value={linkImg}
                                        onChange={(e) => setLinkImg(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className="form-group mb-2">
                                    <input
                                        type="anoPublicacao"
                                        placeholder="Ano de Publicacao"
                                        name="anoPublicacao"
                                        className="form-control"
                                        value={anoPublicacao}
                                        onChange={(e) => setAnoPublicacao(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <div className="form-group mb-2">
                                    <input
                                        type="estoque"
                                        placeholder="Estoque"
                                        name="estoque"
                                        className="form-control"
                                        value={estoque}
                                        onChange={(e) => setEstoque(e.target.value)}
                                    >
                                    </input>
                                </div>

                                <button className="btn" onClick={(e) => saveOrUpdateLivro(e)} >Salvar </button>
                                <Link to="/" className="btn"> Cancel </Link>
                            </form>

                        </div>
                    </div>
                </div>

            </div>

        </div>
    )
}

export default AddUpdateClienteComponent;
